import React, { Component } from 'react';

class Form extends Component {
    state = {}
    render() {
        return (
            <div>
                <h3>Rapport</h3>
                <label for="date">Date : </label>
                <input type="date" id="date" name="date"></input>
            </div>
        );
    }
}

export default Form;
